import axios from 'axios'
import { useState } from 'react'

const RandomCatThings =()=>{

    const [nfo, setNfo]=useState('karesz')

    axios('https://cat-fact.herokuapp.com/facts')  .then((res) =>setNfo(JSON.stringify(res.data.text)))
    return (
        "Random cat things"
        ,{nfo}
    );
}

export default RandomCatThings
